import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'
import NavDropdown from 'react-bootstrap/NavDropdown'

const NavBar = () => {
    function toHome(){
        document.getElementById('anchor0').scrollIntoView();
    };

    return (
        <>
        <Navbar bg="dark" expand="sm" fixed='top'>
        <Navbar.Brand href="#anchor0">MyNav</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
            <Nav.Link onClick='toHome()'>Home</Nav.Link>
            <Nav.Link id='projectButon'>Projects</Nav.Link>
            <NavDropdown title="Dropdown" id="basic-nav-dropdown">
                <NavDropdown.Item href="#action/3.1" className='dropLinks'>Action</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2" className='dropLinks' >Another action</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.3" className='dropLinks'>Something</NavDropdown.Item>
                {/* <NavDropdown.Divider /> */}
                <NavDropdown.Item href="#action/3.4" className='dropLinks'>Separated link</NavDropdown.Item>
            </NavDropdown>
            </Nav>
        </Navbar.Collapse>
        </Navbar>
        </>
    )
}

export default NavBar
